function create_game() {
    const canvas = document.createElement('canvas')
    canvas.id = 'canvas'
    canvas.width = 1920;
    canvas.height = 1080;
    document.getElementById('game').appendChild(canvas)
}

function start_game() {
    const canvas = document.getElementById('canvas')
    const ctx = canvas.getContext('2d')

    function create_menu(name, background_color, foreground_color, x, y, width, height, buttons) {
        if (name === undefined) {
            console.error('You have to pass a name for the menu!')
            return
        }

        const found = menus.find(menu => menu.name === name);
        if (found) {
            console.error("The name must be unique!")
            return
        }
        
        if (buttons === undefined) buttons = [];
        if (x === undefined) x = 0;
        if (y === undefined) y = 0;
        if (width === undefined) width = canvas.width;
        if (height === undefined) height = canvas.height;
        if (buttons === undefined) button = [];
        
        menus.push({ name, x, y, width, height, background_color, foreground_color, buttons })
    }

    function get_menu(name) {
        return menus.find(menu => menu.name === name)
    }

    function draw_menu(name) {
        const menu = get_menu(name)
        if (menu === undefined) return

        ctx.fillStyle = menu.background_color;
        ctx.fillRect(menu.x, menu.y, menu.width, menu.height);

        ctx.fillStyle = menu.foreground_color;
        ctx.font = "100px Comic Sans MS";
        ctx.textAlign = 'center'
        ctx.fillText(name, menu.width/2, 150);

        menu.buttons.forEach(button => draw_button(button))
    }

    function create_menu_buttons(name, texts, main_color, hovered_color, disabled_color) {
        let menu = get_menu(name)
        if (menu === undefined) return;
        if (main_color === undefined) main_color = 'gray';
        if (hovered_color === undefined) hovered_color = '#5c5c5c';
        if (disabled_color === undefined) disabled_color = 'black';
        
        let button_width = menu.width*0.2;
        let button_height = button_width*0.3;
        let i = menu.height/2 - (texts.length * button_height+20)/2;
        texts.forEach((text) => {
            menu.buttons.push(create_button(canvas.width/2 - button_width/2, i, button_width, button_height, text, main_color, hovered_color, disabled_color))
            i+=button_height+20;
        })
    }

    function create_button(x, y, width, height, text, main_color, hovered_color, disabled_color) {        
        if (main_color === undefined) main_color = 'gray'
        if (hovered_color === undefined) hovered_color = 'red'
        if (disabled_color === undefined) disabled_color = 'black'
        
        return {
            x,
            y,
            width,
            height,
            text,
            main_color,
            hovered_color,
            disabled_color,
            color: main_color,
            is_disabled: false,
        }
    }

    function draw_button(button) {
        ctx.fillStyle = button.color;
        if (button.is_disabled) ctx.fillStyle = button.disabled_color
        
        ctx.fillRect(button.x, button.y, button.width, button.height);

        ctx.strokeStyle = 'black';
        ctx.strokeRect(button.x, button.y, button.width, button.height);
        
        ctx.fillStyle = 'white'
        ctx.font = " 50px Comic Sans MS";
        ctx.textAlign = 'center'
        ctx.fillText(button.text, button.x + button.width/2, button.y + button.height/2 + 15)
    }

    document.addEventListener('mousemove', (event) => {
        const mouse_pos = getMousePos(event)

        canvas.classList.remove('cursor-pointer')

        if (is_running) {
            buttons.forEach(button => {
                if (is_hovered(button, mouse_pos)) {
                    canvas.classList.add('cursor-pointer')
                    button.color = button.hovered_color
                } else {
                    button.color = button.main_color
                }
            })
            return;
        }

        menus.forEach(menu => {
            menu.buttons.forEach(button => {
                if (is_hovered(button, mouse_pos)) {
                    canvas.classList.add('cursor-pointer')
                    button.color = button.hovered_color
                } else {
                    button.color = button.main_color
                }
            })
        })
    })

    canvas.addEventListener('mousedown', (event) => {
        const mouse_pos = getMousePos(event)
        
        if (is_running) {
            buttons.forEach(button => {
                if (is_hovered(button, mouse_pos) && !button.is_disabled) {
                    check_letter(button.text)
                    button.is_disabled = true;
                }
            })
            return;
        }

        
        menus.forEach(menu => {
            menu.buttons.forEach(button => {
                if (!is_hovered(button, mouse_pos)) return;
                if (menu_name === 'Main Menu') {
                    switch (button.text) {
                        case 'English':
                            mode = 'english'
                            start()
                            is_running = true
                            break;
                        case 'Greek':
                            mode = 'greek'
                            start()
                            is_running = true
                            break;
                    }
                } else if (menu_name === 'You Win' || menu_name === 'You Lose') {
                    switch (button.text) {
                        case 'Replay':
                            start();
                            is_running = true;
                            break;
                        case 'Menu':
                            menu_name = 'Main Menu'
                            break;
                    }
                }
            })
        })
    })

    const abc = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'
    const alphabet = 'ΑΒΓΔΕΖΗΘΙΚΛΜΝΞΟΠΡΣΤΥΦΧΨΩ'
    let buttons = [];

    let lifes = 10;

    let is_running = false;
    const menus = []

    create_menu('Main Menu', '#5f0101', '#bfbfbf')
    create_menu_buttons('Main Menu', ['English', 'Greek'])

    create_menu('You Win', 'rgba(0,0,0,0)', '#63ed24');
    create_menu_buttons('You Win', ['Replay', 'Menu'])

    create_menu('You Lose', 'rgba(0,0,0,0)', '#fc0303');
    create_menu_buttons('You Lose', ['Replay', 'Menu'])
    
    let menu_name = 'Main Menu'

    let mode = 'english'

    let word = ''
    let hidden_word = [];
    let wrong_letters = [];

    let wins_in_row = 0;

    function start() {
        if (mode === 'english')
            word = get_words()[Math.floor(Math.random()*get_words().length)];
        else
            word = get_greek_words()[Math.floor(Math.random()*get_greek_words().length)];
        hidden_word = new Array(word.length).fill('_');
        buttons = []
        if (mode === 'english')
            create_buttons(abc)
        else
            create_buttons(alphabet)
        wrong_letters = []
        lifes = 10;
    }

    function create_buttons(alphabet) {
        let x = (canvas.width-(alphabet.length/2)*60)/2, y=canvas.height/2
        for (let i=0; i<alphabet.length; i++) {
            buttons.push(create_button(x, y, 50, 75, alphabet.charAt(i), 'green'))
            x+=60
            if (i === alphabet.length/2-1) {
                y+=100
                x = (canvas.width-(alphabet.length/2)*60)/2
            }
        }
    }

    function run() {
        if (is_running)
            draw()
        else 
            draw_menu(menu_name)

        requestAnimationFrame(run)
    }

    function is_hovered(button, mouse_pos) {
        if (mouse_pos.x > button.x && mouse_pos.x < button.x + button.width && mouse_pos.y > button.y && mouse_pos.y < button.y + button.height) return true
        return false
    }

    function check_letter(key_letter) {
        let found = false;
        word.split('').forEach((letter, index) => {
            if (key_letter === letter) {
                hidden_word[index] = letter
                found = true;
                check_words()
            }
        })
        if (!found) {
            lifes--;
            wrong_letters.push(key_letter)
            if (lifes <= 0) {
                lose();
            }
        }

        return found
    }

    function check_words() {
        let hw = ''
        for (let i=0; i<hidden_word.length; i++) {
            hw += hidden_word[i]
        }

        if (hw === word) win();
    }

    function win() {
        menu_name = 'You Win'
        setTimeout(() => {
            is_running = false;
            wins_in_row++;
        }, 100)
    }

    function lose() {
        word.split('').forEach((letter, idx) => {
            hidden_word[idx] = letter
        })
        menu_name = 'You Lose';
        setTimeout(() => {
            is_running = false;
            wins_in_row = 0;
        }, 100)
    }

    function draw() {
        clear_canvas()
        draw_hidden_word()
        buttons.forEach(button => {
            draw_button(button);
        })
        draw_wrong_letters()
        draw_image()
    }

    function draw_hidden_word() {
        ctx.fillStyle = 'black'
        ctx.font = "50px Comic Sans MS";
        ctx.textAlign = 'center'
        let h_w = ''
        hidden_word.forEach(letter => h_w += letter+'  ')
        h_w = h_w.slice(0, -2)
        ctx.fillText(h_w, canvas.width/2, 400)
    }

    function draw_wrong_letters() {
        ctx.fillStyle = 'black';
        ctx.font = "50px Comic Sans MS";
        ctx.textAlign = 'center'
        ctx.fillText(wrong_letters, canvas.width/2, 900)
    }

    function draw_image() {
        const image = new Image(300, 300);
        let image_name = lifes+1;
        image.src = 'http://localhost:5000/games/hangman/images/'+image_name+'.png';
        ctx.drawImage(image, -50, -50);
    }

    function clear_canvas() {
        ctx.fillStyle = '#7d5959'
        ctx.fillRect(0, 0, canvas.width, canvas.height)
    }

    function getMousePos(event) {
        var rect = canvas.getBoundingClientRect();
        const scaleX = canvas.width / rect.width;
        const scaleY = canvas.height / rect.height;
        
        return {
            x: (event.clientX - rect.left) * scaleX,
            y: (event.clientY - rect.top) * scaleY
        }
    }

    run()
}

function load() {
    create_game()
    start_game()
}

load()

